import React, { Component } from 'react';
import axios from 'axios';
class Homepage extends Component {
    state = {
        category: [],
    }
    componentDidMount(){
        axios.get('http://127.0.0.1:8000/category/category/').then(response => this.setState({ category:response.data }));
        console.log(this.state);
    }
    render() {
        return (
            <div>
                <h1>Categories</h1>
                <p>{this.state.category}</p>
            </div>
        )
    }
}

export default Homepage;
